var $bm_rt;
function easeandwizz_outQuad(t, b, c, d) {
    return sum(mul(mul($bm_neg(c), t /= d), sub(t, 2)), b);
}
function easeAndWizz() {
    var t, d, sX, eX;
    var n = 0;
    if (numKeys > 0) {
        n = nearestKey(time).index;
        if (key(n).time > time) {
            n--;
        }
    }
    try {
        var key1 = key(n);
        var key2 = key(sum(n, 1));
    } catch (e) {
        return null;
    }
    t = sub(time, key1.time);
    d = sub(key2.time, key1.time);
    sX = key1.time;
    eX = sub(key2.time, key1.time);
    if (time < key1.time || time > key2.time) {
        return null;
    } else {
        return valueAtTime(easeandwizz_outQuad(t, sX, eX, d));
    }
}
$bm_rt = easeAndWizz() || value;

